import React from 'react'
import { FiHome } from 'react-icons/fi';
import Config from '../Utils/Config';

function Error404() {
    return (
        <div className="text-center">
            <h1 className="text-primary fs-5xl">Error <span className="text-danger">404</span></h1>
            <p className="text-primary">Oops ! Something Went Wrong</p>
            <a href={Config.homePageUrl} className="btn btn-primary d-inline-flex align-items-center"><FiHome className="me-2" />Go Home</a>
        </div>
    )
}

export default Error404;
